import React from 'react'


class List extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      users: []
    };
  }

  getUsersData() {
      const users = []
      const { auth } = this.prop.getState()
      // axios.get('/api/v1/users',{})
      // .then(res => {
      //   const data = res.data
      //   console.log(data)
      //   data.articles.forEach( (user, i) => {
      //     users.push( 
      //       <div></div>
      //     )
      //   })
      //   this.setState({users})
      // }).catch(error => {
      //   console.log(error)
      // })
      axios({
        url: `/api/v1/users`,
        headers: {
          'access-token': auth.accessToken,
          'client': auth.client,
          'uid': auth.uid,
          'expiry': auth.expiry,
          'token-type': 'Bearer'
        }
      }).then(response => {
        const data = res.data
        console.log(data)
      }).catch(error => {
        console.log(error)
      })
  }

  componentDidMount(){
    this.getUsersData()
  }

  render() {
    return (
      <div className="content-page">
        <div className="content">
          <div className="container-fluid">
            <div className="row">
              <div className="col-12">
                <div className="page-title-box">
                  <h4 className="page-title">Article list</h4>
                  <div>
                    <ol className="breadcrumb m-0">
                      <li className="breadcrumb-item active">Articles list</li>
                    </ol>
                  </div>
                </div>
              </div>
            </div>
            <div className="row">
              <div className="col-12">
                <div className="card">
                  <div className="card-body">
                    <div className="responsive-table-plugin">
                      <div className="table-rep-plugin">
                        <div className="table-responsive" data-pattern="priority-columns">
                          <table id="tech-companies-1" className="table table-striped">
                            <thead>
                              <tr>
                                <th>Company</th>
                                <th data-priority="1">Last Trade</th>
                                <th data-priority="3">Trade Time</th>
                                <th data-priority="1">Change</th>
                                <th data-priority="3">Prev Close</th>
                                <th data-priority="3">Open</th>
                                <th data-priority="6">Bid</th>
                                <th data-priority="6">Ask</th>
                                <th data-priority="6">1y Target Est</th>
                              </tr>
                            </thead>
                            <tbody>
                              <tr>
                                <th>GOOG <span className="co-name">Google Inc.</span></th>
                                <td>597.74</td>
                                <td>12:12PM</td>
                                <td>14.81 (2.54%)</td>
                                <td>582.93</td>
                                <td>597.95</td>
                                <td>597.73 x 100</td>
                                <td>597.91 x 300</td>
                                <td>731.10</td>
                              </tr>
                            </tbody>
                          </table>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}

export default List
